def resolve_memoryerror():
    import math

    N, M = [int(e) for e in input().split()]
    S, T = input(), input()

    L = math.lcm(N, M)
    X = [""] * L # memory error
    LN, LM = L // N, L // M

    for i in range(N):
        X[LN * i] = S[i]
    
    for j in range(M):
        if X[LM * j] not in ("", T[j]):
            print(-1)
            break
    else:
        print(L)

def resolve():
    import math

    N, M = [int(e) for e in input().split()]
    S, T = input(), input()

    L = math.lcm(N, M)
    LN, LM = L // N, L // M
    for i in range(0, L, math.lcm(LN, LM)):
        if S[i // LN] != T[i // LM]:
            print(-1)
            break
    else:
        print(L)

