import sys
from io import StringIO
import unittest


class TestClass(unittest.TestCase):
    def assertIO(self, input, output):
        stdout, stdin = sys.stdout, sys.stdin
        sys.stdout, sys.stdin = StringIO(), StringIO(input)
        resolve()
        sys.stdout.seek(0)
        out = sys.stdout.read()[:-1]
        sys.stdout, sys.stdin = stdout, stdin
        self.assertEqual(out, output)

    def test_0(self):
        input = """43331 83942

"""
        output = """3637290802"""
        self.assertIO(input, output)
    
    def test_1(self):
        input = """3 3
abc
abc"""
        output = """3"""
        self.assertIO(input, output)
    
    def test_2(self):
        input = """3 6
abc
aabbcc"""
        output = """6"""
        self.assertIO(input, output)
    
    def test_(self):
        input = """1 3
a
aaa"""
        output = """3"""
        self.assertIO(input, output)
    
    def test_入力例_1(self):
        input = """3 2
acp
ae"""
        output = """6"""
        self.assertIO(input, output)

    def test_入力例_2(self):
        input = """6 3
abcdef
abc"""
        output = """-1"""
        self.assertIO(input, output)

    def test_入力例_3(self):
        input = """15 9
dnsusrayukuaiia
dujrunuma"""
        output = """45"""
        self.assertIO(input, output)


if __name__ == "__main__":
    unittest.main()
